import React, { useState } from 'react';

function LoadMore() {
  const [pokemon, setPokemon] = useState(null);
  const loadMorePokemon = () => {
    console.log(pokemon);
  };
  return (
    <div>
      <button onClick={() => loadMorePokemon()} className="buttonLoad">
        Load More
      </button>
    </div>
  );
}

export default LoadMore;
